/** @format */

import React, { Fragment, useState } from "react";
import {
  Table,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableBody,
  Typography,
  FormGroup,
  FormControlLabel,
  Checkbox,
  Box,
} from "@mui/material";

const LedgerTImeList = () => {
  const [ledgerData, setLedgerData] = useState([]);
  return (
    <Fragment>
      <Box>
        <Typography component="h3">All Matters Task's List</Typography>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Cateagory</TableCell>
                <TableCell>Sub-Category</TableCell>
                <TableCell>Detail</TableCell>
                <TableCell>Date</TableCell>
                <TableCell>Qty</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Total</TableCell>
                <TableCell>BillBy</TableCell>
              </TableRow>
              {ledgers?.map((matter) => {
                <TableBody id={matter.id}>
                  <TableCell>{matter.type}</TableCell>
                  <TableCell>{matter.name}</TableCell>
                  <TableCell>{matter.lastAction}</TableCell>
                  <TableCell>{matter.nextAction}</TableCell>
                  <TableCell>{matter.assign_to}</TableCell>
                </TableBody>;
              })}
            </TableHead>
          </Table>
        </TableContainer>
      </Box>
    </Fragment>
  );
};

export default LedgerTImeList;
